description:
Understanding Karate Do represents years of research, training, and teaching. The book includes a brief history of karate, detailed descriptions of general principles, as well as lists of techniques, drills, and kata practiced in various karate styles. Articles on Japanese terminology, physical conditioning, karate precepts and philosophy, and more are also included. This edition also details Mizuumi ryu Karate, the style developed and taught at Johnston Karate.
